  titulo: {
    borderWidth:1,
    borderColor: '#4d4d4d',
    height: '5%',
    alignItems: 'center',
    backgroundColor: '#4d4d4d'
  },
  txt_titulo: {
    padding: 5,
    fontWeight: 'bold',
    color: '#c1c1c1'
  },
